INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (3378, 28911, 'Valganciclovir', 'Food increases the bioavailability of ganciclovir from the prodrug, valganciclovir.  In 16 HIV-positive subjects, the administration of valganciclovir 875 mg once daily with a high-fat meal containing approximately 600 calories resulted in a 30% increase in the steady-state area under the plasma concentration-time curve (AUC) and a 14% increase in the peak plasma concentration (Cmax) of ganciclovir, with no delay in the time to reach peak plasma concentration (Tmax).', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c05c1810d80200c04c0557e02a771815a1f21d2929482eb7b7756c2c45711cd150c047598d1ef89ac92d8d21f716ddac76e818b4879e9f85a5618a5cfe30782d619b7', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (3380, 29091, 'Venetoclax', 'Food enhances the oral bioavailability of venetoclax.  Relative to fasting conditions, venetoclax systemic exposure (AUC) increased by approximately 3.4-fold when administered with a low-fat meal and by 5.1- to 5.3-fold when administered with a high-fat meal.', 'high-fat foods', 'Major', '', 'DDInter', 0, X'', NULL, X'');
