INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (3473, 7733, 'Warfarin', 'Enhanced hypoprothrombinemic response to warfarin has been reported in patients with acute alcohol intoxication and/or liver disease.  The proposed mechanisms are inhibition of warfarin metabolism and decreased synthesis of clotting factors.  Binge drinking may exacerbate liver impairment and its metabolic ability in patients with liver dysfunction.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
