INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (3485, 33148, 'Warfarin', 'Enhanced hypoprothrombinemic response to warfarin has been reported in patients with acute alcohol intoxication and/or liver disease.  The proposed mechanisms are inhibition of warfarin metabolism and decreased synthesis of clotting factors.  Binge drinking may exacerbate liver impairment and its metabolic ability in patients with liver dysfunction.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (3486, 7733, 'Warfarin', 'Vitamin K may antagonize the hypoprothrombinemic effect of oral anticoagulants.  Vitamin K is a cofactor in the synthesis of blood clotting factors that are inhibited by oral anticoagulants, thus intake of vitamin K through supplements or diet can reverse the action of oral anticoagulants.  Resistance to oral anticoagulants has been associated with consumption of foods or enteral feedings high in vitamin K content.  Likewise, a reduction of vitamin K intake following stabilization of anticoagulant therapy may result in elevation of the INR and bleeding complications.  Foods rich in vitamin K include beef liver, broccoli, Brussels sprouts, cabbage, collard greens, endive, kale, lettuce, mustard greens, parsley, soy beans, spinach, Swiss chard, turnip greens, watercress, and other green leafy vegetables.  Moderate to high levels of vitamin K are also found in other foods such as asparagus, avocados, dill pickles, green peas, green tea, canola oil, margarine, mayonnaise, olive oil, and soybean oil.  Snack foods containing the fat substitute, olestra, are fortified with 80 mcg of vitamin K per each one ounce serving so as to offset any depletion of vitamin K that may occur due to olestra interference with its absorption.  Whether these foods can alter the effect of oral anticoagulants has not been extensively studied.  One small study found that moderate consumption (1.5 servings/day) does not significantly affect the INR after one week in patients receiving long-term anticoagulation.', 'food high in vitamin K', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
